import React from "react";
import { Button, Checkbox, Label } from "semantic-ui-react";

const Submit: React.FC = () => {
  return (
    <React.Fragment>
      <div>
        <Checkbox toggle label={<Label>Berk</Label>} />
      </div>
      <Button primary size="large">
        Berk
      </Button>
    </React.Fragment>
  );
};

export default Submit;
